// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;



import "./Verificador.sol";

contract Factoring{

    //Definim els elements que formen el contracte

    //1. Persona que tokeniza la factura, vol el pagament abans
    address private invoicer;

    //2. Inversors, compren tokens
    address[] private investors;

    //3. Document verificat
    Verificacio public verificat;
    bool private isVerified;
    uint256 private value;
    uint private expDays;

    //4. Collateral/Garantia del facturador, si és un actiu no liquid s'indicarà el seu valor
    uint256 private collateral;
    bool private isLiquidCol;

    event NewDocument(address indexed owner, string filename, uint256 value, uint256 collateral, uint daysRemaining);
    
    constructor(string memory _filename, uint256 _value, uint256 _collateral, uint _days, bool _isLiquid){
        invoicer = msg.sender;
        isVerified = false;
        value = _value;
        expDays = _days;
        collateral = _collateral;
        isLiquidCol = _isLiquid;

        verificat = new Verificacio(_filename);
        
        emit NewDocument(invoicer, _filename, value, collateral, expDays);
    }


    //Getters
    function getInvoicer() public view returns(address){
        return invoicer;
    }

    function isVerifiedDoc() public view returns(bool) {
        return isVerified;
    }

    function isLiquidCollateral() public view returns(bool) {
        return isLiquidCol;
    }

    function getValue() public view returns(uint256){
        return value;
    }

    function getExpDays() public view returns(uint){
        return expDays;
    }

    function getCollateral() public view returns(uint256){
        return collateral;
    }

    




}

PFG/Verificador.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Verificacio{

    //1. Elements del contracte

    // Primer identifiquem el propietari del document
    address private propietari;

    // Nom del document
    string private filename;

    // Validadors del document
    address[] private validadors;
    // No validadors del document
    address[] private denegadors;

    // Mapa de comprovació de les validacions amb un comentari
    mapping (address=>bool) private validacions;
    // Mapa de comprovació de les denegacions amb un comentari
    mapping (address=>bool) private denegacions;


    //2. CONSTRUCTOR
    event OwnerSet(address indexed propietari, string asset);
    
    constructor(string memory _filename) {
        propietari = msg.sender;
        filename = _filename;

        emit OwnerSet(propietari, filename);
    }

    //3. VALIDAR
    event Validation(address indexed validador, string asset);

    function validate() public {
        require(propietari != msg.sender, "El propietari no pot validar el seu asset");
        require(!validacions[msg.sender], "Validador repetit");
        require(!denegacions[msg.sender], "No pots validar i denegar alhora");
        validadors.push(msg.sender);
        validacions[msg.sender] = true;

        emit Validation(msg.sender, filename);

    }

    //4. DENEGAR
    event Denegation(address indexed denegador, string asset);

    function denegate() public {
        require(propietari != msg.sender, "El propietari no pot validar el seu asset");
        require(!denegacions[msg.sender], "Denegador repetit");
        require(!validacions[msg.sender], "No pots validar i denegar alhora");
        denegadors.push(msg.sender);
        denegacions[msg.sender] = true;

        emit Denegation(msg.sender, filename);

    }



    //Getters
    function hasValidated(address _user) public view returns(bool) {
        require(propietari != _user);
        return validacions[_user];
    }

    function hasDenied(address _user) public view returns(bool) {
        require(propietari != _user);
        return denegacions[_user];
    }

    function getOwner() public view returns(address){
        return propietari;
    }

    function getFilename() public view returns(string memory){
        return filename;
    }

    function nValidations() public view returns(uint256) {
        return validadors.length;
    }

    function nDenegations() public view returns(uint256) {
        return denegadors.length;
    }

    //PROBLEMES
    /*
    1. No comprova si existeix realment o no el document
    2. No se sap si pot ser una copia o no
    
    */

    


}

